import {Link} from "react-router-dom";

const UserRoutes = () => {
    return (
        <>
            <li>
                <Link to={`/user/profile`}> Profile </Link>
            </li>
            <li>
                <Link to={`/user/userdashboard`}> User Dashboard </Link>
            </li>
            <h1>Welcome User!!!</h1>
        </>
    );
};

export default UserRoutes
